import React, { useState } from 'react';

const Search = (props) => {
	const [text, setText] = useState('');

	return (
		<form>
			<input
				type="text"
				value={text}
				placeholder="Superhero"
				onChange={(e) => {
					setText(e.target.value);
				}}
			/>
			<button>Submit</button>
		</form>
	);
};

export default Search;
